import { jsPDF } from "jspdf";

const font = '';
const registerCooperFont = () => {
    jsPDF.API.events.push(['addFonts', function () {
        this.addFileToVFS('Cooper-ExtraBold-normal.ttf', font);
        this.addFont('Cooper-ExtraBold-normal.ttf', 'Cooper-ExtraBold', 'normal');
    }]);
};

export default registerCooperFont;

